import React from "react";
import PeopleAltOutlinedIcon from "@mui/icons-material/PeopleAltOutlined";
import Stack from '@mui/material/Stack';
import Item from '@mui/material/Stack';

const Sidenavbar = () => {
  return (
    <div className="sidenavbar">
      <div className="sidenavbar__container">
        <div className="sidenavbar__container__item">
          <div className="flex ">

            <div className="sidenavbar__container__item__icon">
              {/* <i className="fas fa-home" /> */}

            </div>
            <div className="sidenavbar__container__item__text">Add Student</div>
          </div>
        </div>
        <div className="sidenavbar__container__item">
          <div className="sidenavbar__container__item__icon">
            <i className="fas fa-user" />
          </div>
          <div className="sidenavbar__container__item__text">Profile</div>
        </div>
        <div className="sidenavbar__container__item">
          <div className="sidenavbar__container__item__icon">
            <i className="fas fa-envelope" />
          </div>
          <div className="sidenavbar__container__item__text">Messages</div>
        </div>
        <div className="sidenavbar__container__item">
          <div className="sidenavbar__container__item__icon">
            <i className="fas fa-cog" />
          </div>
          <div className="sidenavbar__container__item__text">Settings</div>
        </div>
      </div>
    </div>
  );
};

export default Sidenavbar;
